				if(item.hr || item.mgrAccess)
					html.push('		<i class="fa fa-group blue"></i> <a onClick="getEmployeeProfile(this)" empId="'+item.pernr+'" href="#">'+langMap.js_search_employee_label_employee_profile+'</a><br>');
