						html.push('		<i class="fa fa-file blue"></i> <a onClick="goToMyForm(this)" ref="showEmpSearch" readGoalForm="'+readGoalForm+'" formId="'+formIdValue+'" href="#">'+langMap.js_search_employee_label_view_goal_plan+'</a><br>');
