function get_thumbnail(img, size, type) {
	var w = img.width, h = img.height;
	
	//**IE10** is not giving correct width using img.width so we use $(img).width()
	w = w > 0 ? w : $(img).width()
	h = h > 0 ? h : $(img).height()

	if(w > size || h > size) {
	  if(w > h) {
		h = parseInt(size/w * h);
		w = size;
	  } else {
		w = parseInt(size/h * w);
		h = size;
	  }
	}


	var dataURL
	try {
		var canvas = document.createElement('canvas');
		canvas.width = w; canvas.height = h;
		var context = canvas.getContext('2d');
		context.drawImage(img, 0, 0, img.width, img.height, 0, 0, w, h);
		dataURL = canvas.toDataURL(/*type == 'image/jpeg' ? type : 'image/png', 10*/)
	} catch(e) {
		dataURL = null;
	}
	if(! dataURL) return null;
	

	//there was only one image that failed in firefox completely randomly! so let's double check things
	if( !( /^data\:image\/(png|jpe?g|gif);base64,[0-9A-Za-z\+\/\=]+$/.test(dataURL)) ) dataURL = null;
	if(! dataURL) return null;
	

	return {src: dataURL, w:w, h:h};
}
function launchEditPool(ele){
	var empId = $(ele).attr("empid");
	var empName = encodeURIComponent($(ele).attr("empName")).replace(new RegExp("'", "g"), "\\'");
	var orgUnit = $(ele).attr("orgUnit");
	refreshScope('D','X',orgUnit,empId);
}

